exports=async function(a,b){const{parseCatalog:c}=await require("transcode/parse_catalog"),d=`http://www.duqu.net/html/${a.idPrefix()}/${a}/`;return c(d,[null,/<div class="volume">\s*\S+ (?<volume>[^<]+)<\/div>|<a href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)</g],{clientOptions:{...(b&&b.clientOptions)},preprocess:a=>a.substring(a.indexOf("<div class=\"index\">"),a.lastIndexOf("<div id=\"tuijian\">"))})};